  discrete sample, physical and profile data collected from ATLANTIS II in the North
  Atlantic Ocean from 1981-06-12 to 1981-07-08 and retrieved during cruise 31AN19810612.
  These data include DISSOLVED OXYGEN, HYDROSTATIC PRESSURE, NITRATE, NITRITE, PHOSPHATE,
  Potential temperature (theta), SALINITY, SILICATE and WATER TEMPERATURE. The instruments
  used to collect these data include CTD and bottle. These data were collected by
  C. Wunsch of Unknown as part of the GLODAPv2_31AN19810612 data set.\",\n\t\"owner_org\":
